import React from 'react';

class TaskList extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            tasks: []
        }
      }

    componentDidMount() {
        const tasks = fetch('https://jsonplaceholder.typicode.com/todos')
            .then(function(response) {
                return response.json();
            });
        console.log(tasks)
            this.setState({ tasks });
    }

    render() {
        return (
            <div>
                {JSON.stringify(this.state.tasks)}
            </div>
        )

    }
}

export default TaskList;
